import React, { useContext } from 'react';
import Footer from '../components/Footer';
import perfilIcon from '../images/profileIcon.svg';
import { Link } from 'react-router-dom';
import requestApi from '../services/functions';
import RecipesContext from '../context/RecipesContext';

function FoodArea() {
 const {filterSearch,
  searchInput,
  setRecipesFilters} = useContext(RecipesContext)

  const searchButton = (filter, inputSearch, setFilter) => {
    requestApi(filter, inputSearch, setFilter);
  };

  return (
    <div>
      <header>
        <h1 data-testid="page-title" >
          Explorar Origem
        </h1>
      <Link to="/perfil">
        <button type="button" >
          <img
            data-testid="profile-top-btn"
            src={perfilIcon}
            alt="perfil"
          />
        </button>
        <button
        onClick={() => searchButton(filterSearch,
          searchInput,
          setRecipesFilters)}
        data-testid="exec-search-btn"
        type="button"
      >
        Buscar
      </button>
      </Link>
      </header>
      this is food area
      <Footer />
    </div>

  );
}

export default FoodArea;
